import React from 'react'
import style from '../styles/nav.css'

const Nav = () => {
  return (
    <div>
        <link rel="stylesheet" href={style}></link>
        <nav>
            <img src="" className='nav--logo'/>
        </nav>
    </div>
  )
}

export default Nav
